import { PieChart } from 'react-minimal-pie-chart';

export default function SentiResults(props){
    console.log(props);
    return (

        <PieChart
            center={[50, 50]}
            data={[
                {
                color: "#E38627",
                title: "One",
                value: props.positive,
                },
                {
                color: "#C13C37",
                title: "Two",
                value: props.negative,
                },
                {
                color: "#6A2135",
                title: "Three",
                value: props.neutral,
                },
            ]}
            labelPosition={50}
            lengthAngle={360}
            lineWidth={5}
            paddingAngle={0}
            radius={50}

            startAngle={0}
            viewBoxSize={[100, 100]}
        />

);}
